"use strict";!function(){var e=angular.module("registration",[]);e.controller("RegController",["$scope","$window","$http",function(e,n,r){e.email=n.email,e.lunchers=n.lunchers,e.selected=e.lunchers[0],e.register=function(){r.put("/db/luncher/"+e.selected.id,{email:e.email}).success(function(){n.location.href="/"}).error(function(e,r){n.alert("Registration failed. ("+r+") "+JSON.stringify(e))})}}])}();